import React from "react";
import "./qualifications.css";

export default function () {
  return (
    <section className="qualifications section">
      <h2 className="section-title">Qualifications</h2>
      <span className="section-subtitle">Education</span>

      <div className="qualification-container container">
        <div className="qualification-tabs">
          <div className="qualification-button button-flex">
            {/* icon */}
            Education
          </div>

          {/* <div className="qualification-button button-flex"> */}
          {/* icon */}
          {/* Experience */}
          {/* </div> */}
        </div>
        <div className="qualification-sections">
          <div className="qualification-content">
            <div className="qualification-data">
              <div>
                <h3 className="qualification-title"></h3>
                <span className="qualification-subtitle">D.A.V. Public Schi</span>
                <div className="qualification-calender">2021-present</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}
